import React from "react";
import './Pokemon.css'


export default function Pokemon({name, img, types}){
    return (
        <div className="container">
            <img className="img" src={img} alt="pokemon"/>
            <h3 className="name">{name}</h3>
            <h4 className="types">{types.map(t => t.name)}</h4>
        </div>
    )
}
